import { FC } from "react";

const Home: FC = () => {
    return (
        <div>
            <h1>Home</h1>
            <ul>
                <li><a href="/work">Work Experiences</a></li>
                <li><a href="/projects">Personal Projects and Certifications</a></li>
                <li><a href="/uni">Notable University Courseworks</a></li>
            </ul>
        </div>
    )
};

export default Home;
